import React, { useEffect, useState } from "react";
import { useNavigate, useParams } from "react-router-dom";
import { getSingleAdminApi } from "../../apis/Api";

const AdminView = () => {
  const { id } = useParams();
  const navigate = useNavigate();

  //UseEffect
  useEffect(() => {
    getSingleAdminApi(id).then((res) => {
      console.log(res.data);
      setfirstName(res.data.admin.firstName);
      setlastName(res.data.admin.lastName);
      setEmail(res.data.admin.email);
      setOldImage(res.data.doctor.uploadValidIdUrl);
    });
  }, [id]);

  //Make UseState
  const [firstName, setfirstName] = useState("");
  const [lastName, setlastName] = useState("");
  const [email, setEmail] = useState("");
  const [phoneNo, setPhoneNo] = useState("");
  const [oldImage, setOldImage] = useState("");

  return (
    <>
      <section class="vh-100 ">
        <div class="container py-5 d-flex justify-content-center">
          <div className="col col-md-10 col-sm-12 col-lg-8">
            <div
              class="card d-flex align-items-center shadow-lg"
              style={{
                background: "linear-gradient(to top, #ffffff, #61C0BF)",
              }}
            >
              <div class="col-md-6 col-lg-9 d-flex align-items-center">
                <div class="card-body p-8 p-lg-5 text-black">
                  <form>
                    <div class=" mb-9 pb-10 ">
                      <i class="fas fa-cubes fa-2x me-2 d-flex justify-content-center"></i>
                    </div>

                    <h3 class="fw-bold d-flex justify-content-center">
                      Your Details -{" "}
                      <span className="text-danger">{firstName}</span>
                    </h3>

                    <div className="modal-body">
                        {/* //1st row */}
                        <div className="row">
                          <div className="col">
                            <label>First Name</label>
                            <input
                              value={firstName}
                              className="form-control mb-2"
                              type="text"
                              name=""
                              id=""
                              placeholder="Enter your First Name"
                              style={{ width: "200px" }}
                            />
                          </div>
                          <div className="col">
                            <label>Last Name</label>
                            <input
                              value={lastName}
                              className="form-control mb-2"
                              type="text"
                              name=""
                              id=""
                              placeholder="Enter your Last Name"
                              style={{ width: "200px" }}
                            />
                          </div>
                        </div>
                        {/* //2st row */}
                        <div className="row">
                          <div className="col">
                            <label> Email</label>
                            <input
                              value={email}
                              className="form-control mb-2"
                              type="email"
                              name=""
                              id=""
                              placeholder="Enter Your Email"
                              style={{ width: "200px" }}
                            />
                          </div>
                          <div className="col">
                            <label>Phone Number</label>
                            <input
                              value={phoneNo}
                              className="form-control mb-2"
                              type="number"
                              name=""
                              id=""
                              placeholder="Enter Your Phone Number"
                              style={{ width: "200px" }}
                            />
                          </div>
                        </div>
                      <div>
                        <h6>Valid Id</h6>
                        <img
                          className="img-fluid rounded-4 object-fit-cover"
                          width={200}
                          height={200}
                          src={oldImage}
                          alt=""
                        />
                      </div>
                      <div class="pt-1 mb-4 d-flex text-center justify-content-center">
                        <button
                          type="button"
                          className="btn w-50 mb-2 btn btn-dark"
                          onClick={() => navigate("/admin/dashboard")}
                        >
                          Back
                        </button>
                      </div>
                    </div>
                  </form>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default AdminView;
